import React, { useEffect, useState } from "react";
import General from "../american-football-player.png";
import friends from "../friends.png";
import more from "../more.png";
import Menu from "./Menu";
const Nav = (props) => {
  let [teamImage, setImage] = useState("../american-football-player.png");

  useEffect(() => {
    switch (props.currTeam) {
      case "General":
        setImage(General);
      case "Cardinals":
        setImage(Cardials);
      case "Falcons":
        setImage(Falcons);
      case "Panthers":
        setImage(Panthers);
      case "Ravens":
        setImage(Raens);
      case "Bills":
        setImage(Bills);
      case "Bengals":
        setImage(Bengals);
      case "Bears":
        setImage(Bears);
      case "Cowboys":
        setImage(Cowboys);
      case "Lions":
        setImage(Lions);
      case "Packers":
        setImage(Pakcers);
      case "Rams":
        setImage(Rams);
      case "Browns":
        setImage(Browns);
      case "Broncos":
        setImage(Broncos);
      case "Texans":
        setImage(Colts);
      case "Jaguars":
        setImage(Jaguars);
      case "General":
        setImage(General);
      case "General":
        setImage(General);
      case "General":
        setImage(General);
      case "General":
        setImage(General);
      case "General":
        setImage(General);
      case "General":
        setImage(General);
      case "General":
        setImage(General);
      case "General":
        setImage(General);
    }
  }, [props.currTeam]);
  return (
    <div>
      <ul class="bg-[#DA1E55] py-[8px] flex justify-around fixed w-screen top-0 z-30 items-center">
        <button
          onClick={() => {
            if (props.isOpen == false) {
              props.setOpen(true);
            } else {
              props.setOpen(false);
            }
          }}
        >
          <img
            className="w-[2em] h-[2em]"
            src={more}
            alt="description of image"
          />
        </button>

        <img
          className="w-[5em] h-[5em] md:mx-[10em]"
          src={teamImage}
          alt="description of image"
        />
        <img
          className="w-[2em] h-[2em]"
          src={friends}
          alt="description of image"
        />
      </ul>
    </div>
  );
};

export default Nav;
